- type: inline
  contents: '[package]

    name = "nod"

    version = "2.0.0-alpha.3"

    edition = "2024"

    rust-version = "1.85"

    authors = ["Luke Street <luke@street.dev>"]

    license = "MIT OR Apache-2.0"

    repository = "https://github.com/encounter/nod"

    documentation = "https://docs.rs/nod"

    readme = "../README.md"

    description = "Library for reading and writing GameCube and Wii disc images.\n"

    keywords = ["gamecube", "wii", "iso", "wbfs", "rvz"]

    categories = ["command-line-utilities", "parser-implementations"]


    [features]

    default = ["compress-bzip2", "compress-lzma", "compress-zlib", "compress-zstd"]

    compress-bzip2 = ["bzip2"]

    compress-lzma = ["liblzma", "liblzma-sys"]

    compress-zlib = ["adler", "miniz_oxide"]

    compress-zstd = ["zstd", "zstd-safe"]

    openssl = ["dep:openssl"]

    openssl-vendored = ["openssl", "openssl/vendored"]


    [dependencies]

    aes = "0.9.0-rc.0"

    base16ct = "0.2"

    bytes = "1.10"

    cbc = "0.2.0-rc.0"

    crc32fast = "1.5"

    crossbeam-channel = "0.5"

    crossbeam-utils = "0.8"

    dyn-clone = "1.0"

    encoding_rs = "0.8"

    itertools = "0.14"

    lru = "0.16"

    polonius-the-crab = "0.4"

    simple_moving_average = "1.0"

    thiserror = "2.0"

    tracing = "0.1"


    [dependencies.adler]

    version = "1.0"

    optional = true


    [dependencies.bzip2]

    version = "0.6"

    features = ["static"]

    optional = true


    [dependencies.digest]

    version = "0.11.0-rc.0"

    default-features = false


    [dependencies.liblzma]

    version = "0.4"

    features = ["static"]

    optional = true


    [dependencies.liblzma-sys]

    version = "0.4"

    features = ["static"]

    optional = true


    [dependencies.md-5]

    version = "0.11.0-rc.0"

    default-features = false


    [dependencies.miniz_oxide]

    version = "0.8"

    optional = true


    [dependencies.openssl]

    version = "0.10"

    optional = true


    [dependencies.sha1]

    version = "0.11.0-rc.0"

    default-features = false


    [dependencies.xxhash-rust]

    version = "0.8"

    features = ["xxh64"]


    [dependencies.zerocopy]

    version = "0.8"

    features = ["alloc", "derive"]


    [dependencies.zstd]

    version = "0.13"

    optional = true

    default-features = false


    [dependencies.zstd-safe]

    version = "7.2"

    optional = true

    default-features = false

    '
